  input: TEXT,F3XA,,"Upon realizing that administrative expenses were incorrectly
    paid for in 2003, the Democratic Party of Virginia immediately began the process
    of reviewing all expenses in 2003 to recalculate the administrative costs on the
    28/72 split.  As a result we have included as memo entries all administrative
    costs for January 1, 2003 to June 30, 2003. Please note that the amount that was
    transferred from the federal account to the non-federal account during this reporting
    period more than sufficiently covers the federal portion of the administrative
    expenses."
